INSERT INTO `tbl_dbaas_image` VALUES (1,'024551699e91317fdd0698f1947c2a531761c7c6412ee5865517a3f4abe5abeb','upsql',3040,'sha256:549b42a8f499a592b3bf94c2adb2ee1e1172f8bf58b94d61b681247d994b0c2a','5.6.19','1111303e7d9715f8eb3f661f7e59603e0a6840ae6cfd4f072b06f087f3af99d9','','{\"myisamchk::key_buffer_size\":{\"Key\":\"myisamchk::key_buffer_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range: 8--OS_PER_PROCESS_LIMIT, Index blocks for MyISAM tables are buffered and are shared by all threads. key_buffer_size is the size of the buffer used for index blocks. The key buffer is also known as the key cache.\"},\"myisamchk::sort_buffer_size\":{\"Key\":\"myisamchk::sort_buffer_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range:32768--18446744073709551615 ,Each session that must perform a sort allocates a buffer of this size. sort_buffer_size is not specific to any storage engine and applies in a general manner for optimization. \"},\"mysqld::auto_increment_increment\":{\"Key\":\"mysqld::auto_increment_increment\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range:1--65535 ,auto_increment_increment and auto_increment_offset are intended for use with master-to-master replication, and can be used to control the operation of AUTO_INCREMENT columns. \"},\"mysqld::auto_increment_offset\":{\"Key\":\"mysqld::auto_increment_offset\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range: 1--65535,This variable has a default value of 1. For more information, see the description for auto_increment_increment.\"},\"mysqld::bind_address\":{\"Key\":\"mysqld::bind_address\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: string, The MySQL server listens on a single network socket for TCP/IP connections. This socket is bound to a single address, but it is possible for an address to map onto multiple network interfaces.  \"},\"mysqld::binlog_cache_size\":{\"Key\":\"mysqld::binlog_cache_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range:4096--18446744073709551615,The size of the cache to hold changes to the binary log during a transaction. A binary log cache is allocated for each client if the server supports any transactional storage engines and if the server has the binary log enabled (--log-bin option). \"},\"mysqld::binlog_checksum\":{\"Key\":\"mysqld::binlog_checksum\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: string, When enabled, this variable causes the master to write a checksum for each event in the binary log. binlog_checksum supports the values NONE (disabled) and CRC32. The default is CRC32 as of MySQL 5.6.6, NONE before that.\"},\"mysqld::binlog_format\":{\"Key\":\"mysqld::binlog_format\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:enumeration, range:ROW,STATEMENT,MIXED, This variable sets the binary logging format, and can be any one of STATEMENT, ROW, or MIXED. See Section 17.1.2, “Replication Formats”. binlog_format is set by the --binlog-format option at startup, or by the binlog_format variable at runtime.\"},\"mysqld::binlog_row_image\":{\"Key\":\"mysqld::binlog_row_image\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:enumeration , In MySQL row-based replication, each row change event contains two images, a “before” image whose columns are matched against when searching for the row to be updated, and an “after” image containing the changes. \"},\"mysqld::character_set_server\":{\"Key\":\"mysqld::character_set_server\",\"CanSet\":true,\"MustRestart\":false,\"Description\":\"type:string, The server\'s default character set.\"},\"mysqld::connect_timeout\":{\"Key\":\"mysqld::connect_timeout\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer, range:2--31536000, The number of seconds that the mysqld server waits for a connect packet before responding with Bad handshake. The default value is 10 seconds.\"},\"mysqld::datadir\":{\"Key\":\"mysqld::datadir\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: directory name, The path to the data directory.\"},\"mysqld::enforce_gtid_consistency\":{\"Key\":\"mysqld::enforce_gtid_consistency\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:boolean , When enabled, this option enforces GTID consistency by allowing execution of only those statements that can be logged in a transactionally safe manner. You must enable --enforce-gtid-consistency before setting --gtid-mode to ON; otherwise, enabling GTID mode fails with an error. You can (and should) use this option prior to using --gtid-mode, in order to test whether the system is ready to use GTIDs.\"},\"mysqld::expire_logs_days\":{\"Key\":\"mysqld::expire_logs_days\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range:0--99,The number of days for automatic binary log file removal. The default is 0, which means “no automatic removal.” Possible removals happen at startup and when the binary log is flushed. \"},\"mysqld::explicit_defaults_for_timestamp\":{\"Key\":\"mysqld::explicit_defaults_for_timestamp\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:boolean, In MySQL, the TIMESTAMP data type differs in nonstandard ways from other data types\"},\"mysqld::gtid_mode\":{\"Key\":\"mysqld::gtid_mode\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: enumeration, range: ON,OFF,This option specifies whether global transaction identifiers (GTIDs) are used to identify transactions. Starting the server with --gtid-mode=ON requires that the server also be started with the --log-bin, --log-slave-updates, and --enforce-gtid-consistency options.\"},\"mysqld::innodb_buffer_pool_instances\":{\"Key\":\"mysqld::innodb_buffer_pool_instances\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: integer, range:1--64 ,The number of regions that the InnoDB buffer pool is divided into. For systems with buffer pools in the multi-gigabyte range, dividing the buffer pool into separate instances can improve concurrency, by reducing contention as different threads read and write to cached pages. \"},\"mysqld::innodb_buffer_pool_size\":{\"Key\":\"mysqld::innodb_buffer_pool_size\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:integer , range:5242880--2**64-1 ,The size in bytes of the buffer pool, the memory area where InnoDB caches table and index data. The default value is 128MB. The maximum value depends on the CPU architecture; the maximum is 4294967295 (232-1) on 32-bit systems and 18446744073709551615 (264-1) on 64-bit systems. On 32-bit systems, the CPU architecture and operating system may impose a lower practical maximum size than the stated maximum. \"},\"mysqld::innodb_checksums\":{\"Key\":\"mysqld::innodb_checksums\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:boolean , range: ON,InnoDB can use checksum validation on all tablespace pages read from the disk to ensure extra fault tolerance against hardware faults or corrupted data files. \"},\"mysqld::innodb_data_file_path\":{\"Key\":\"mysqld::innodb_data_file_path\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: string, range: on, off, The paths to individual InnoDB data files and their sizes. The full directory path to each data file is formed by concatenating innodb_data_home_dir to each path specified here. The file sizes are specified KB, MB or GB (1024MB) by appending K, M or G to the size value.\"},\"mysqld::innodb_doublewrite\":{\"Key\":\"mysqld::innodb_doublewrite\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: boolean, range:ON ,If this variable is enabled (the default), InnoDB stores all data twice, first to the doublewrite buffer, then to the actual data files. \"},\"mysqld::innodb_file_per_table\":{\"Key\":\"mysqld::innodb_file_per_table\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: boolean, range: ON,When innodb_file_per_table is enabled (the default in 5.6.6 and higher), InnoDB stores the data and indexes for each newly created table in a separate .ibd file, rather than in the system tablespace. \"},\"mysqld::innodb_flush_log_at_trx_commit\":{\"Key\":\"mysqld::innodb_flush_log_at_trx_commit\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: enumeration, Controls the balance between strict ACID compliance for commit operations, and higher performance that is possible when commit-related I/O operations are rearranged and done in batches. You can achieve better performance by changing the default value, but then you can lose up to a second of transactions in a crash.\"},\"mysqld::innodb_flush_method\":{\"Key\":\"mysqld::innodb_flush_method\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: string, range:on, off ,Defines the method used to flush data to the InnoDB data files and log files, which can affect I/O throughput. This variable is only configurable on Unix and Linux systems.\"},\"mysqld::innodb_io_capacity\":{\"Key\":\"mysqld::innodb_io_capacity\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range:100--2**64-1 ,The innodb_io_capacity parameter sets an upper limit on the I/O activity performed by the InnoDB background tasks, such as flushing pages from the buffer pool and merging data from the change buffer. \"},\"mysqld::innodb_lock_wait_timeout\":{\"Key\":\"mysqld::innodb_lock_wait_timeout\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range:1--1073741824 ,The length of time in seconds an InnoDB transaction waits for a row lock before giving up. The default value is 50 seconds. \"},\"mysqld::innodb_log_buffer_size\":{\"Key\":\"mysqld::innodb_log_buffer_size\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: integer, range:262144--4294967295 ,The size in bytes of the buffer that InnoDB uses to write to the log files on disk. The default value is 8MB. A large log buffer enables large transactions to run without a need to write the log to disk before the transactions commit. \"},\"mysqld::innodb_log_file_size\":{\"Key\":\"mysqld::innodb_log_file_size\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: integer, range:1048576--512GB / innodb_log_files_in_group ,The size in bytes of each log file in a log group. The combined size of log files (innodb_log_file_size * innodb_log_files_in_group) cannot exceed a maximum value that is slightly less than 512GB. \"},\"mysqld::innodb_log_files_in_group\":{\"Key\":\"mysqld::innodb_log_files_in_group\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: integer, range: 2--100,The number of log files in the log group. InnoDB writes to the files in a circular fashion. The default (and recommended) value is 2. The location of these files is specified by innodb_log_group_home_dir. The combined size of log files (innodb_log_file_size * innodb_log_files_in_group) can be up to 512GB.\"},\"mysqld::innodb_log_group_home_dir\":{\"Key\":\"mysqld::innodb_log_group_home_dir\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: directory name, The directory path to the InnoDB redo log files, whose number is specified by innodb_log_files_in_group. If you do not specify any InnoDB log variables, the default is to create two files named ib_logfile0 and ib_logfile1 in the MySQL data directory.\"},\"mysqld::innodb_max_dirty_pages_pct\":{\"Key\":\"mysqld::innodb_max_dirty_pages_pct\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: numeric, range:0--99 ,InnoDB tries to flush data from the buffer pool so that the percentage of dirty pages does not exceed this value. Specify an integer in the range from 0 to 99. The default value is 75.\"},\"mysqld::innodb_open_files\":{\"Key\":\"mysqld::innodb_open_files\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: integer, range: 10--4294967295,This variable is relevant only if you use multiple InnoDB tablespaces. It specifies the maximum number of .ibd files that MySQL can keep open at one time. The minimum value is 10. As of MySQL 5.6.6, the default value is 300 if innodb_file_per_table is not enabled, and the higher of 300 and table_open_cache otherwise. Before 5.6.6, the default value is 300.\"},\"mysqld::innodb_purge_batch_size\":{\"Key\":\"mysqld::innodb_purge_batch_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range:1--5000 ,The granularity of changes, expressed in units of redo log records, that trigger a purge operation, flushing the changed buffer pool blocks to disk. This option is intended for tuning performance in combination with the setting innodb_purge_threads=n, and typical users do not need to modify it.\"},\"mysqld::innodb_purge_threads\":{\"Key\":\"mysqld::innodb_purge_threads\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:integer , range: 1--32,The number of background threads devoted to the InnoDB purge operation. The new default and minimum value of 1 in MySQL 5.6.5 signifies that the purge operation is always performed by background threads, never as part of the master thread. Non-zero values runs the purge operation in one or more background threads, which can reduce internal contention within InnoDB, improving scalability.\"},\"mysqld::innodb_read_io_threads\":{\"Key\":\"mysqld::innodb_read_io_threads\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:integer , range:1--64 ,The number of I/O threads for read operations in InnoDB. The default value is 4. Its counterpart for write threads is innodb_write_io_threads. \"},\"mysqld::innodb_rollback_on_timeout\":{\"Key\":\"mysqld::innodb_rollback_on_timeout\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: boolean, range:OFF ,In MySQL 5.6, InnoDB rolls back only the last statement on a transaction timeout by default. If --innodb_rollback_on_timeout is specified, a transaction timeout causes InnoDB to abort and roll back the entire transaction (the same behavior as in MySQL 4.1).\"},\"mysqld::innodb_stats_on_metadata\":{\"Key\":\"mysqld::innodb_stats_on_metadata\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:boolean , range:OFF ,When this variable is enabled, InnoDB updates statistics when metadata statements such as SHOW TABLE STATUS or SHOW INDEX are run, or when accessing the INFORMATION_SCHEMA.TABLES or INFORMATION_SCHEMA.STATISTICS tables. \"},\"mysqld::innodb_stats_persistent_sample_pages\":{\"Key\":\"mysqld::innodb_stats_persistent_sample_pages\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, The number of index pages to sample when estimating cardinality and other statistics for an indexed column, such as those calculated by ANALYZE TABLE. Increasing the value improves the accuracy of index statistics, which can improve the query execution plan, at the expense of increased I/O during the execution of ANALYZE TABLE for an InnoDB table.\"},\"mysqld::innodb_stats_sample_pages\":{\"Key\":\"mysqld::innodb_stats_sample_pages\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range:1--2**64-1 ,Deprecated, use innodb_stats_transient_sample_pages instead.\"},\"mysqld::innodb_support_xa\":{\"Key\":\"mysqld::innodb_support_xa\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: boolean, You can also turn off this option if you do not need it for safe binary logging or replication, and you also do not use an external XA transaction manager.\"},\"mysqld::innodb_thread_concurrency\":{\"Key\":\"mysqld::innodb_thread_concurrency\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range:0--1000 ,InnoDB tries to keep the number of operating system threads concurrently inside InnoDB less than or equal to the limit given by this variable (InnoDB uses operating system threads to process user transactions). \"},\"mysqld::innodb_write_io_threads\":{\"Key\":\"mysqld::innodb_write_io_threads\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:integer , range: 1--64,The number of I/O threads for write operations in InnoDB. The default value is 4. Its counterpart for read threads is innodb_read_io_threads. \"},\"mysqld::interactive_timeout\":{\"Key\":\"mysqld::interactive_timeout\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer, range: 1-- , The number of seconds the server waits for activity on an interactive connection before closing it. An interactive client is defined as a client that uses the CLIENT_INTERACTIVE option to mysql_real_connect(). \"},\"mysqld::join_buffer_size\":{\"Key\":\"mysqld::join_buffer_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer, range: 128--18446744073709547520, The minimum size of the buffer that is used for plain index scans, range index scans, and joins that do not use indexes and thus perform full table scans. \"},\"mysqld::key_buffer_size\":{\"Key\":\"mysqld::key_buffer_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range:8--OS_PER_PROCESS_LIMIT, Index blocks for MyISAM tables are buffered and are shared by all threads. key_buffer_size is the size of the buffer used for index blocks. The key buffer is also known as the key cache.\"},\"mysqld::log_bin\":{\"Key\":\"mysqld::log_bin\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: file name, Enable binary logging. The server logs all statements that change data to the binary log, which is used for backup and replication. \"},\"mysqld::log_bin_trust_function_creators\":{\"Key\":\"mysqld::log_bin_trust_function_creators\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:boolean , This option sets the corresponding log_bin_trust_function_creators system variable. If no argument is given, the option sets the variable to 1. log_bin_trust_function_creators affects how MySQL enforces restrictions on stored function and trigger creation.\"},\"mysqld::log_error\":{\"Key\":\"mysqld::log_error\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"\"},\"mysqld::log_queries_not_using_indexes\":{\"Key\":\"mysqld::log_queries_not_using_indexes\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:boolean, If you are using this option with the slow query log enabled, queries that are expected to retrieve all rows are logged.\"},\"mysqld::log_slave_updates\":{\"Key\":\"mysqld::log_slave_updates\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: boolean, range: OFF,Normally, a slave does not write to its own binary log any updates that are received from a master server. This option causes the slave to write the updates performed by its SQL thread to its own binary log. \"},\"mysqld::long_query_time\":{\"Key\":\"mysqld::long_query_time\",\"CanSet\":true,\"MustRestart\":false,\"Description\":\"type:numeric, range:0--10, If a query takes longer than this many seconds, the server increments the Slow_queries status variable. If the slow query log is enabled, the query is logged to the slow query log file. This value is measured in real time, not CPU time, so a query that is under the threshold on a lightly loaded system might be above the threshold on a heavily loaded one. The minimum and default values of long_query_time are 0 and 10, respectively. The value can be specified to a resolution of microseconds. \"},\"mysqld::loose_rpl_semi_sync_master_enabled\":{\"Key\":\"mysqld::loose_rpl_semi_sync_master_enabled\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"loose_rpl_semi_sync_master_enabled\"},\"mysqld::loose_rpl_semi_sync_slave_enabled\":{\"Key\":\"mysqld::loose_rpl_semi_sync_slave_enabled\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"loose_rpl_semi_sync_slave_enabled\"},\"mysqld::lower_case_table_names\":{\"Key\":\"mysqld::lower_case_table_names\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:integer , range:0--2, If set to 0, table names are stored as specified and comparisons are case sensitive. If set to 1, table names are stored in lowercase on disk and comparisons are not case sensitive. If set to 2, table names are stored as given but compared in lowercase. This option also applies to database names and table aliases. \"},\"mysqld::master_info_repository\":{\"Key\":\"mysqld::master_info_repository\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: string, The setting of this variable determines whether the slave logs master status and connection information to a FILE (master.info), or to a TABLE (mysql.slave_master_info).\"},\"mysqld::master_verify_checksum\":{\"Key\":\"mysqld::master_verify_checksum\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:boolean ,Enabling this variable causes the master to examine checksums when reading from the binary log. master_verify_checksum is disabled by default; in this case, the master uses the event length from the binary log to verify events, so that only complete events are read from the binary log.\"},\"mysqld::max_allowed_packet\":{\"Key\":\"mysqld::max_allowed_packet\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range: 1024--1073741824, The maximum size of one packet or any generated/intermediate string, or any parameter sent by the mysql_stmt_send_long_data() C API function. The default is 4MB as of MySQL 5.6.6, 1MB before that.The maximum size of one packet or any generated/intermediate string, or any parameter sent by the mysql_stmt_send_long_data() C API function. The default is 4MB as of MySQL 5.6.6, 1MB before that.\"},\"mysqld::max_binlog_size\":{\"Key\":\"mysqld::max_binlog_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"\"},\"mysqld::max_connect_errors\":{\"Key\":\"mysqld::max_connect_errors\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range: 0--18446744073709551615, If more than this many successive connection requests from a host are interrupted without a successful connection, the server blocks that host from further connections. You can unblock blocked hosts by flushing the host cache. \"},\"mysqld::max_connections\":{\"Key\":\"mysqld::max_connections\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range: 1--100000, The maximum permitted number of simultaneous client connections. By default, this is 151.\"},\"mysqld::max_relay_log_size\":{\"Key\":\"mysqld::max_relay_log_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range:0--1073741824, The size at which the server rotates relay log files automatically. If this value is nonzero, the relay log is rotated automatically when its size exceeds this value. \"},\"mysqld::max_user_connections\":{\"Key\":\"mysqld::max_user_connections\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range: 0--4294967295,The maximum number of simultaneous connections permitted to any given MySQL user account. A value of 0 (the default) means “no limit.”\"},\"mysqld::net_read_timeout\":{\"Key\":\"mysqld::net_read_timeout\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer, range:1-- ,The number of seconds to wait for more data from a connection before aborting the read. When the server is reading from the client, net_read_timeout is the timeout value controlling when to abort. \"},\"mysqld::net_write_timeout\":{\"Key\":\"mysqld::net_write_timeout\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range:1-- ,The number of seconds to wait for a block to be written to a connection before aborting the write. See also net_read_timeout.\"},\"mysqld::open_files_limit\":{\"Key\":\"mysqld::open_files_limit\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:integer , range: 0--platform dependent, The number of files that the operating system permits mysqld to open. The value of this variable at runtime is the real value permitted by the system and might be different from the value you specify at server startup. The value is 0 on systems where MySQL cannot change the number of open files.\"},\"mysqld::optimizer_switch\":{\"Key\":\"mysqld::optimizer_switch\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: set, The optimizer_switch system variable enables control over optimizer behavior. The value of this variable is a set of flags, each of which has a value of on or off to indicate whether the corresponding optimizer behavior is enabled or disabled. This variable has global and session values and can be changed at runtime. The global default can be set at server startup.\"},\"mysqld::plugin_dir\":{\"Key\":\"mysqld::plugin_dir\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:directory name , The path name of the plugin directory.\"},\"mysqld::plugin_load\":{\"Key\":\"mysqld::plugin_load\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"plugin load\"},\"mysqld::port\":{\"Key\":\"mysqld::port\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range: 0--65535, The number of the port on which the server listens for TCP/IP connections. This variable can be set with the --port option.\"},\"mysqld::relay_log\":{\"Key\":\"mysqld::relay_log\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: file name, The name of the relay log file.\"},\"mysqld::relay_log_info_repository\":{\"Key\":\"mysqld::relay_log_info_repository\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: string, This variable determines whether the slave\'s position in the relay logs is written to a FILE (relay-log.info) or to a TABLE (mysql.slave_relay_log_info).\"},\"mysqld::relay_log_purge\":{\"Key\":\"mysqld::relay_log_purge\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:boolean, Disable or enable automatic purging of relay logs as soon as they are no longer needed. The default value is 1 (enabled). This is a global variable that can be changed dynamically with SET GLOBAL relay_log_purge = N. Disabling purging of relay logs when using the --relay-log-recovery option risks data consistency.\"},\"mysqld::relay_log_recovery\":{\"Key\":\"mysqld::relay_log_recovery\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: boolean, Enables automatic relay log recovery immediately following server startup. The recovery process creates a new relay log file,\"},\"mysqld::replicate_ignore_db\":{\"Key\":\"mysqld::replicate_ignore_db\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type:string , As with --replicate-do-db, the effects of this option depend on whether statement-based or row-based replication is in use.\"},\"mysqld::rpl_semi_sync_master_enabled\":{\"Key\":\"mysqld::rpl_semi_sync_master_enabled\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: boolean, range: OFF,Controls whether semisynchronous replication is enabled on the master. To enable or disable the plugin, set this variable to ON or OFF (or 1 or 0), respectively. The default is OFF.\"},\"mysqld::rpl_semi_sync_master_timeout\":{\"Key\":\"mysqld::rpl_semi_sync_master_timeout\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range: 10000,A value in milliseconds that controls how long the master waits on a commit for acknowledgment from a slave before timing out and reverting to asynchronous replication. The default value is 10000 (10 seconds).\"},\"mysqld::rpl_semi_sync_master_trace_level\":{\"Key\":\"mysqld::rpl_semi_sync_master_trace_level\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: integer, range:32 ,The semisynchronous replication debug trace level on the master. Four levels are defined\"},\"mysqld::rpl_semi_sync_master_wait_no_slave\":{\"Key\":\"mysqld::rpl_semi_sync_master_wait_no_slave\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: boolean, range:ON ,With semisynchronous replication, for each transaction, the master waits until timeout for acknowledgment of receipt from some semisynchronous slave.\"},\"mysqld::rpl_semi_sync_slave_enabled\":{\"Key\":\"mysqld::rpl_semi_sync_slave_enabled\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type: boolean, range:OFF ,Controls whether semisynchronous replication is enabled on the slave. To enable or disable the plugin, set this variable to ON or OFF (or 1 or 0), respectively. The default is OFF.\"},\"mysqld::rpl_semi_sync_slave_trace_level\":{\"Key\":\"mysqld::rpl_semi_sync_slave_trace_level\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range:32 ,The semisynchronous replication debug trace level on the slave. See rpl_semi_sync_master_trace_level for the permissible values.\"},\"mysqld::server_id\":{\"Key\":\"mysqld::server_id\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer, range: 0--4294967295, This option is common to both master and slave replication servers, and is used in replication to enable master and slave servers to identify themselves uniquely.  \"},\"mysqld::skip_external_locking\":{\"Key\":\"mysqld::skip_external_locking\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: boolean, range: on, This is OFF if mysqld uses external locking (system locking), ON if external locking is disabled. This affects only MyISAM table access.\"},\"mysqld::slave_net_timeout\":{\"Key\":\"mysqld::slave_net_timeout\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , The number of seconds to wait for more data from a master/slave connection before aborting the read.\"},\"mysqld::slave_parallel_workers\":{\"Key\":\"mysqld::slave_parallel_workers\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range:0--1024 ,Sets the number of slave worker threads for executing replication events (transactions) in parallel. Setting this variable to 0 (the default) disables parallel execution. The maximum is 1024.\"},\"mysqld::slave_sql_verify_checksum\":{\"Key\":\"mysqld::slave_sql_verify_checksum\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:boolean , range: 0, 1,Cause the slave SQL thread to verify data using the checksums read from the relay log. In the event of a mismatch, the slave stops with an error. \"},\"mysqld::slow_query_log\":{\"Key\":\"mysqld::slow_query_log\",\"CanSet\":true,\"MustRestart\":false,\"Description\":\"type:boolean, Whether the slow query log is enabled. The value can be 0 (or OFF) to disable the log or 1 (or ON) to enable the log. The default value depends on whether the --slow_query_log option is given. The destination for log output is controlled by the log_output system variable; if that value is NONE, no log entries are written even if the log is enabled.\"},\"mysqld::slow_query_log_file\":{\"Key\":\"mysqld::slow_query_log_file\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:file name, The name of the slow query log file. The default value is host_name-slow.log, but the initial value can be changed with the --slow_query_log_file option.\"},\"mysqld::socket\":{\"Key\":\"mysqld::socket\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: string, On Unix, this option specifies the Unix socket file to use when listening for local connections. The default value is /tmp/mysql.sock. If this option is given, the server creates the file in the data directory unless an absolute path name is given to specify a different directory. On Windows, the option specifies the pipe name to use when listening for local connections that use a named pipe. The default value is MySQL (not case sensitive). \"},\"mysqld::sort_buffer_size\":{\"Key\":\"mysqld::sort_buffer_size\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer, range: 32768--18446744073709551615, Each session that must perform a sort allocates a buffer of this size. sort_buffer_size is not specific to any storage engine and applies in a general manner for optimization. \"},\"mysqld::sync_binlog\":{\"Key\":\"mysqld::sync_binlog\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer , range: 0--4294967295,If the value of this variable is greater than 0, the MySQL server synchronizes its binary log to disk (using fdatasync()) after sync_binlog commit groups are written to the binary log. The default value of sync_binlog is 0, which does no synchronizing to disk—in this case, the server relies on the operating system to flush the binary log\'s contents from time to time as for any other file.\"},\"mysqld::tmpdir\":{\"Key\":\"mysqld::tmpdir\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: directory name, The path of the directory to use for creating temporary files. It might be useful if your default /tmp directory resides on a partition that is too small to hold temporary tables. \"},\"mysqld::user\":{\"Key\":\"mysqld::user\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"\"},\"mysqld::wait_timeout\":{\"Key\":\"mysqld::wait_timeout\",\"CanSet\":true,\"MustRestart\":false,\"Description\":\"type:integer , range:1--31536000 ,The number of seconds the server waits for activity on a noninteractive connection before closing it.\"},\"mysqldump::max_allowed_packet\":{\"Key\":\"mysqldump::max_allowed_packet\",\"CanSet\":false,\"MustRestart\":false,\"Description\":\"type:integer, range: 1024--1073741824, The maximum size of one packet or any generated/intermediate string, or any parameter sent by the mysql_stmt_send_long_data() C API function. The default is 4MB as of MySQL 5.6.6, 1MB before that.\"}}\n',1,'2016-11-09 13:16:11'),(2,'12f9208c3af3034b07ebbe8ced81d8e66b7a768fe2bebdf9fb471c9fd8a1eb99','upproxy',1787,'sha256:6cd74fcbbd1e4f03ab800de44de73cd55fee6c8b47e0aacd8c8ff291710a0533','1.1.0','ddf25af206915f3f92d8738bd186dae4e4377b2566882c485f985138f628e231','','{\"adm-cli::adm-cli-address\":{\"Key\":\"adm-cli::adm-cli-address\",\"CanSet\":false,\"MustRestart\":true,\"Description\":\"type: string\"},\"adm-cli::adm-cli-event-threads-count\":{\"Key\":\"adm-cli::adm-cli-event-threads-count\",\"CanSet\":false,\"MustRestart\":true,\"Desc